import React, {Component} from 'react';
import Table from "./Simulations";

class Data extends Component {
    render() {
        return (
            <>
                <div className="row">
                    <Table columns={this.columns} data={this.state.sketches} />

                    <div className="m-2 col">
                        {this.RenderCard()}
                    </div>
                </div>
            </>
        );
    }
}

export default Data;
